import React from 'react'
import { StyleSheet } from 'react-native'
import { Text } from 'react-native-paper'

export default function Title() {
    return <Text style={styles.textt} />
  }

  const styles = StyleSheet.create({  
    textt: { 
    fontSize: 64,
    marginTop: 10,
    marginBottom: 10,
    color: 'black',
  },
})
